7c-b6b4-89cc1651ad7f\"},\"useSeparator\":\"disabled\"},{\"content\":{\"params\":{\"text\":\"<h3><strong>Activity 3</strong></h3>\\n\\n<p>Based on the above results, complete the following statements by selecting the right option.</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"c26924e5-5516-4c39-87ae-7776ee0299a1\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"choices\":[{\"subContentId\":\"853963b9-7796-46f6-bfe1-b4131dbe78cb\",\"question\":\"<p>1) A natural number is said to be prime if ---</p>\\n\",\"answers\":[\"<p>it admits exactly two divisors, one and itself.</p>\\n\",\"<p>it admits at least two divisors.</p>\\n\"]},{\"subContentId\":\"270b6fe1-b47b-4c18-8480-09a7ce74744f\",\"question\":\"<p>2) A natural number is said to be composite if ---</p>\\n\",\"answers\":[\"<p>it admits at least three divisors.</p>\\n\",\"<p>it admits at least two divisors.</p>\\n\"]},{\"subContentId\":\"06ac2cc9-9dc0-4a63-b81b-d5a3bb697b17\",\"question\":\"<p>3) The only even prime numter is ---</p>\\n\",\"answers\":[\"<p>2</p>\\n\",\"<p>0</p>\\n\"]},{\"subContentId\":\"1114ee27-1c06-4b5f-83bf-1ce92fcf7eb1\",\"question\":\"<p>4) All even numbers greater than 2 are ---</p>\\n\",\"answers\":[\"<p>composite.</p>\\n\",\"<p>prime.</p>\\n\"]},{\"subContentId\":\"fffcf1cd-c95d-46fb-81b8-7e4949760060\",\"question\":\"<p>5) All composite numbers can be written as a product of ---</p>\\n\",\"answers\":[\"<p>prime factors.</p>\\n\",\"<p>even numbers.</p>\\n\"]},{\"subContentId\":\"0754bfa9-2f1e-4701-8181-f6533e802eba\",\"question\":\"<p>6) 17 is a prime number since ---</p>\\n\",\"answers\":[\"<p>it admits exactly two divisors, one and itself.</p>\\n\",\"<p>it is odd.</p>\\n\"]},{\"subContentId\":\"f514ed29-555b-4be1-8400-fb638c27f4b8\",\"question\":\"<p>7) 1 is not a prime number because ---</p>\\n\",\"answers\":[\"<p>it does not have exactly two divisors.</p>\\n\",\"<p>it has more than two divisors.</p>\\n\"]}],\"overallFeedback\":[{\"from\":0,\"to\":100}],\"behaviour\":{\"autoContinue\":true,\"timeoutCorrect\":2000,\"timeoutWrong\":3000,\"soundEffectsEnabled\":true,\"enableRetry\":true,\"enableSolutionsButton\":true,\"passPercentage\":100},\"l10n\":{\"nextButtonLabel\":\"Next question\",\"showSolutionButtonLabel\":\"Show solution\",\"retryButtonLabel\":\"Retry\",\"solutionViewTitle\":\"Solution list\",\"correctText\":\"Correct!\",\"incorrectText\":\"Incorrect!\",\"muteButtonLabel\":\"Mute feedback sound\",\"closeButtonLabel\":\"Close\",\"slideOfTotal\":\"Slide :num of :total\",\"scoreBarLabel\":\"You got :num out of :total points\",\"solutionListQuestionNumber\":\"Question :num\",\"a11yShowSolution\":\"Show the solution. The task will be marked with its correct solution.\",\"a11yRetry\":\"Retry the task. Reset all responses and start the task over again.\",\"shouldSelect\":\"Should have been selected\",\"shouldNotSelect\":\"Should not have been selected\"}},\"library\":\"H5P.SingleChoiceSet 1.11\",\"metadata\":{\"contentType\":\"Single Choice Set\",\"license\":\"U\",\"title\":\"Untitled Single Choice Set\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Untitled Single Choice Set\"},\"subContentId\":\"c5cf623b-f2e0-4be5-91da-8f24d5f75551\"},\"useSeparator\":\"disabled\"}]}","library":"H5P.Column 1.15","contentUrl":".","metadata":{"license":"CC BY-NC-ND","title":"Identify Prime Numbers","defaultLanguage":"und","authors":[{"name":"LAL-Tabshoura","role":"Author"}],"licenseVersion":"4.0"},"scripts":["/h5p/libraries/H5P.AdvancedText-1.1/text.js?version=1.1.14","/h5p/libraries/H5P.Image-1.1/image.js?version=1.1.22","/h5p/libraries/H5P.Transition-1.0/transition.js?version=1.0.4","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-help-dialog.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-message-dialog.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-progress-circle.js?version=1.3.19","/h5p/libraries
